import React from 'react'
import PropTypes from 'prop-types'
require('./styles.css');
import cake from '../../images/johnny-birthday/johnny-cake.jpg';
import happyBirthdayFace from '../../images/johnny-birthday/happy-birthday-face.jpg';


class JohnysBirthday extends React.Component {
  constructor() {
    super();
    this.state = {
      bShowImage: false
    };
  }
  render() {
    //        <link href="https://webster.cs.washington.edu/css/maze.css" type="text/css" rel="stylesheet" />
    return (
      <div className="custom">
        <title>Maze!</title>
        <br/>
          <br/>
            <br/>
              <br/>
        
        <p id="status">Happy birthday Johnny! Click on the "S" to begin this evil game! Muahahahaha!</p>
        { this.state.bShowImage && <img src={happyBirthdayFace} width="250px"/> }
        {/* This part of the page represents the maze */}
        <div id="maze">
          <div id="start">S</div>
          <div className="boundary" id="boundary1" />
          <div className="boundary" />
          <div className="boundary" />
          <div className="boundary" />
          <div className="boundary" />
          <div id="end"><img src={cake} width="100px" style={{"margin": "0 auto"}}/></div>
        </div>
        <p>
          Get to the cake!  Be sure to avoid the walls:
        </p>
        <div className="boundary example" />
      </div>
    );
  }
  componentDidMount() {
    var boundaries = document.querySelectorAll(".boundary");
    var start = document.querySelector("#start");
    var end = document.querySelector("#end");
    var status = document.querySelector("#status");
    var win = true;
    var aInsults = ["Ha! Looooooooooooser!", "tzzz fail!", "mega FAIL!", "Congratulations, you're the first... LOSER!!!"]

      start.addEventListener("mouseover", function() {
        document.getElementById("status").innerHTML = "Good luck!!! Hahahahah!";
        for (var i = 0; i < boundaries.length; i++) {
          boundaries[i].addEventListener("mouseover", function(e) {
            win = false;
            this.style.background = "red";
            var oAudio = new Audio("data:audio/wav;base64,");
            oAudio.play();
            // alert(aInsults[Math.floor(Math.random() * aInsults.length)]);
            this.style.background = "#eeeeee";
            document.getElementById("status").innerHTML = aInsults[Math.floor(Math.random() * aInsults.length)];
            e.stopPropagation();
          });
        }
        
      });
    var that = this;
    end.addEventListener("mouseover", function() {
      var oAudio = new Audio("data:audio/wav;base64,");
      if (win == true) {
        oAudio.play();
        that.setState({bShowImage:true});
        document.getElementById("status").innerHTML = "NA, ENDLICH! YOU WIN! HAPPY BIRTHDAY YOU LITTLE STINKER!";
        // alert("NA, ENDLICH! YOU WIN! HAPPY BIRTHDAY YOU LITTLE STINKER!");
      }
      win = true;
    });
  }
}

export default JohnysBirthday;